import ExpenseItem from './components/ExpenseItem';
import Expenses from './components/Expenses';

function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2021, 8, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 9, 14) },
    {
      id: 'e3',
      title: 'Car insurance',
      amount: 294.67,
      date: new Date(2022, 0, 5),
    },
    { id: 'e4', title: 'New Desk', amount: 450, date: new Date(2022, 1, 10) },
  ];
  return (
    <div>
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
